local bronann = {};
local kalya = {};

-- the main map loading code
function Load(m)

	Map = m;
	ObjectManager = Map.object_supervisor;
	DialogueManager = Map.dialogue_supervisor;
	EventManager = Map.event_supervisor;
	TreasureManager = Map.treasure_supervisor;
	GlobalEvents = Map.map_event_group;

	Map.unlimited_stamina = true;

	CreateCharacters();
	-- Set the camera focus on Bronann
	Map:SetCamera(bronann);

	CreateNPCs();
	CreateObjects();


	CreateEvents();
	CreateZones();
end

function Update()
	-- Check whether the character is in one of the zones
	CheckZones();
end


-- Character creation
function CreateCharacters()
	bronann = _CreateSprite(Map, "Bronann", 97, 4);
	bronann:SetDirection(hoa_map.MapMode.SOUTH);
	bronann:SetMovementSpeed(hoa_map.MapMode.NORMAL_SPEED);
	bronann:SetNoCollision(false);
	Map:AddGroundObject(bronann);
end

function CreateNPCs()
	local npc = {}
	local text = {}
	local dialogue = {}
	local event = {}

	npc = _CreateNPCSprite(Map, "Woman3", "Lilly", 67, 40);
	Map:AddGroundObject(npc);
	npc:SetDirection(hoa_map.MapMode.WEST);
	dialogue = hoa_map.SpriteDialogue();
	text = hoa_system.Translate("What a nice day, isn't it?");
	dialogue:AddLine(text, npc);
	DialogueManager:AddDialogue(dialogue);
	npc:AddDialogueReference(dialogue);

end

