-- Creates all events and sets up the entire event sequence chain
function CreateEvents()
	local event = {};

	-- Triggered Events
	event = hoa_map.MapTransitionEvent("to Village center", "dat/maps/vt_village_of_layna.lua", "from_riverbed");
	EventManager:RegisterEvent(event);

end

function CreateZones()
	-- N.B.: left, right, top, bottom
	village_center_zone = hoa_map.CameraZone(95, 99, 0, 2, hoa_map.MapMode.CONTEXT_01);
	Map:AddZone(village_center_zone);
end

function CheckZones()
	if (village_center_zone:IsCameraEntering() == true) then
		-- Stop the character as it may walk in diagonal, which is looking strange
		-- when entering
		bronann:SetMoving(false);
		EventManager:StartEvent("to Village center");
	end
end


